              #preloader {
                z-index: 1000;
                display: flex;
                align-items: center;
                justify-content: center;
                flex-direction: column;
                height: 100vh;
                background-image: var(--base64-image);
                background-size: cover;
                background-position: center;
              }

              #blurScreen {
                backdrop-filter: blur(45px);
                width: 100vw;
                height: 100vh;
                position: fixed;
                z-index: -1;
                background-color: rgba(255, 255, 255, 0.2);
              }

              .loader {
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;
                top: 20%;
              }

              #gameIcon {
                width: 116px;
                height: 116px;
                background-color: orangered;
                border-radius: 26px;
                border: 7px solid #FFFFFF;
                animation-name: spaceboots;
                -webkit-animation-name: spaceboots;
                animation-duration: 1.4s;
                -webkit-animation-duration: 1.4s;
                transform-origin: 50% 50%;
                -webkit-transform-origin: 50% 50%;
                animation-iteration-count: infinite;
                -webkit-animation-iteration-count: infinite;
                animation-timing-function: alternate;
                -webkit-animation-timing-function: linear;
                background-image: var(--base64-image);
                background-size: cover;
                background-position: center;
              }

              #gameTitle {
                margin-top: 25px;
                text-align: center;
                font-family: "Abel", sans-serif;
                font-size: 25px;
                font-weight: bold;
                letter-spacing: 2px;
                color: white;
              }

              @-webkit-keyframes spaceboots {
                0% {
                  -webkit-transform: translate(0px, 0px) rotate(-1deg);
                }

                50% {
                  -webkit-transform: translate(0px, 4px) rotate(1deg);
                }

                100% {
                  -webkit-transform: translate(0px, 0px) rotate(-1deg);
                }
              }

              #loader {
                border: 8px solid rgba(200, 200, 200, 0.4);
                border-top: 8px solid #ffffff;
                border-radius: 60%;
                width: 80px;
                height: 80px;
                animation: spin 2s linear infinite;
                margin-top: 25px;
              }

              @keyframes spin {
                0% {
                  transform: rotate(0deg);
                }

                100% {
                  transform: rotate(360deg);
                }
              }
            </style>
  </head><body>
            <div id="preloader">
              <div id="blurScreen"></div>
              <div class="loader">
                <div id="gameIcon"></div>
                <span id="gameTitle">Shuffleboard Challenge</span>
              </div>
              <div id="loader"></div>
            </div>
          <div id="YsoHtmlContainer"></div></body></html>
